  \"Sensor integritY Management and Prognostics Technology with On-line fault Mitigation
  (SYMPTOM) for Improved Flight Safety of Commercial Aircraft Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T01:22:51.786534\",\n\t\"name\": \"sensor-integrity-management-and-prognostics-technology-with-on-line-fault-mitigation-sympt\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"SSCI proposes to develop and test the Sensor
  integritY Management and Prognostics Technology with On-line fault Mitigation (SYMPTOM)
  system. The SYMPTOM assures system integrity by fusing available information from
  a variety of similar and dissimilar sensors and other sources with advanced signal
  processing and dynamic equations of motion to arrive at high-confidence estimates
  of the current sensor health, rapidly and accurately detect and isolate the fault,
  and mitigate its effect before the information from the sensor has been sent to
  the flight controller and the cockpit display. The SYMPTOM system uses all available
  information relevant for flight-critical sensor Fault Detection, Identification
  and Accommodation (FDIA), fuses it to build virtual and software sensors, and applies
  advanced statistical tests, nonlinear estimation and prediction,  and parameter
  estimation schemes to accurately detect, isolate and accommodate the faults in both
  individual sensors and sensor suites. The SYMPTOM leverages our previous work on
  single-thread sensor FDIA. In Phase II of the project, Boeing Phantom Works (Dr.
  Kevin Wise) will provide technical and commercialization support.\",\n\t\"license_title\":
